h of cilantro, chopped','undefined',1,'small bunch of cilantro, chopped','2022-03-20 23:18:49.360014','6570af5a-e811-45b8-a533-c4f06438e1ff'),('bad7235e-dfe2-484e-831b-a47a05544a86','½ cup miniature chocolate chips, or more to taste','cup',1,'miniature chocolate chips, or more to taste','2022-04-03 00:48:58.038140','dd24945a-27fb-47d8-994f-7470d8aaf38a'),('c3e6f75c-2e00-41a9-b902-72ce663f56dc','2 tablespoons coco aminos or soy sauce','tablespoons',2,'coco aminos or soy sauce','2022-03-20 23:18:49.340486','6570af5a-e811-45b8-a533-c4f06438e1ff'),('c4f0262c-74bb-4fa8-9937-19ef5fadee53','2 small handfuls of lettuce','undefined',2,'small handfuls of lettuce','2022-03-13 23:39:14.277188','fed3dedf-43b3-4de5-9433-6028e601bcf1'),('c611400d-be39-45a1-bc21-5098278a4a7c','1 tablespoon whole-grain mustard','tablespoon',1,'whole-grain mustard','2022-03-13 23:39:14.265426','fed3dedf-43b3-4de5-9433-6028e601bcf1'),('c9cb6f45-73b1-44a4-9e64-bd03eb61c818','30 g fresh herbs (mint, parsley, or cilantro) for serving','g',30,' fresh herbs (mint, parsley, or cilantro) for serving','2022-03-06 00:56:49.895233','ce7c42d8-f557-42e1-8e53-d9925bcafd3b'),('cadbbb2d-9401-4b66-bc89-9df953554b69','1/2 of a small lemon','undefined',1,'a small lemon','2022-03-06 02:44:19.118042','3cd3f061-f3bc-4042-84c6-bb5f13722996'),('cefcac2b-b1e5-48de-80f3-128072248bc5','½ tsp sea salt','tsp',1,' sea salt','2022-03-06 00:56:49.879888','ce7c42d8-f557-42e1-8e53-d9925bcafd3b'),('d1a44bda-da4e-473d-a87f-174c26a18697','1 lemon (juice, divided)','undefined',1,' lemon (juice, divided)','2022-03-06 00:56:49.892365','ce7c42d8-f557-42e1-8e53-d9925bcafd3b'),('d5e9b0be-56cc-4583-bcfe-91416b4cf540','¾ cup milk','cup',1,'milk','2022-04-03 00:48:57.940211','dd24945a-27fb-47d8-994f-7470d8aaf38a'),('d8ddf68d-1fd3-4dd7-afde-0e7a882af900','2 large eggs','undefined',2,'large eggs','2022-03-20 22:14:34.261221','b4191208-a0a1-4ea3-a1ce-e6cdeca0af94'),('dcc51cda-4558-4167-a324-23ee2f9309f8','3 cloves garlic','undefined',3,'cloves garlic','2022-03-06 00:56:49.845141','ce7c42d8-f557-42e1-8e53-d9925bcafd3b'),('dfc3cad2-c5d5-4c40-a343-6241d781acba','1 Tablespoon dill pickles','Tablespoon',1,'dill pickles','2022-03-06 02:44:19.102445','3cd3f061-f3bc-4042-84c6-bb5f13722996'),('e64d281b-dc55-40d8-ba67-50a5bb60fc65','½ teaspoon dried dill weed','teaspoon',1,'dried dill weed','2022-03-06 02:44:19.104466','3cd3f061-f3bc-4042-84c6-bb5f13722996'),('e7d30d19-47d6-4125-85cc-c657a7d16caa','Salt and pepper','undefined',NULL,NULL,'2022-03-13 23:39:14.269250','fed3dedf-43b3-4de5-9433-6028e601bcf1'),('e8557fef-f0f4-41b6-ab64-b86fbc96bfd0','1/4 teaspoon Worcestershire sauce','teaspoon',0,'Worcestershire sauce','2022-03-06 02:44:19.112906','3cd3f061-f3bc-4042-84c6-bb5f13722996'),('e9a2e8cc-073d-4137-af17-63d45f17a2d6','3 cups finely shredded green cabbage','cups',3,'finely shredded green cabbage','2022-03-20 23:18:49.349631','6570af5a-e811-45b8-a533-c4f06438e1ff'),('eb14732c-56c9-4f77-b705-ae125410b83d','2 tablespoons white sugar','tablespoons',2,'white sugar','2022-04-03 00:48:57.982553','dd24945a-27fb-47d8-994f-7470d8aaf38a'),('eb1c380e-2b73-4e93-9c1d-036040c2a2c1','2 tbsp homemade vegetable stock concentrate','tbsp',2,' homemade vegetable stock concentrate','2022-03-06 00:56:49.886877','ce7c42d8-f557-42e1-8e53-d9925bcafd3b'),('f9dfe8f9-18e3-4ba6-927f-d446b6566f12','1/4 cup minced yellow onion','cup',0,'minced yellow onion','2022-03-13 23:39:14.272781','fed3dedf-43b3-4de5-9433-6028e601bcf1'),('fd3bd169-7968-403e-af16-2ebe5fdee3c3','1 tablespoon sriracha, or to taste','tablespoon',1,'sriracha, or to taste','2022-03-20 23:18:49.345577','6570af5a-e811-45b8-a533-c4f06438e1ff');
