INSERT INTO `instructions` VALUES ('04ce99be-2d0b-415c-9262-ff79dd7e08d6','Serve with fish and chips, crab cakes or salmon!','2022-03-06 02:44:19.132995','3cd3f061-f3bc-4042-84c6-bb5f13722996',3),('1c39ea35-3204-42ba-aa6e-d7055c369176','Store in the fridge for up to 2 weeks.','2022-03-06 02:44:19.131298','3cd3f061-f3bc-4042-84c6-bb5f13722996',2),('23cf5afc-9873-49c3-9108-775be0ae6142','Whisk milk, eggs, vanilla, cinnamon, and salt together in a shallow bowl.','2022-03-20 22:14:34.285818','b4191208-a0a1-4ea3-a1ce-e6cdeca0af94',1),('28be0da6-1114-4b36-9a6b-81fdc9b8db86','Add chickpeas to stew and let simmer for approx. 10 min. Before serving, add kale and salt to taste. Serve with fresh herbs and lemon juice. Enjoy!','2022-03-06 00:56:49.906658','ce7c42d8-f557-42e1-8e53-d9925bcafd3b',5),('2fdd3366-acf9-4ccd-9c8f-babc4f87f04e','Lightly butter a griddle and heat over medium-high heat.','2022-03-20 22:14:34.289586','b4191208-a0a1-4ea3-a1ce-e6cdeca0af94',2),('325bd357-c55c-4914-81e0-5db769086db4','Combine milk and vinegar in a bowl and set aside for 5 minutes to \"sour\" the milk. You are essentially making your own buttermilk with this step.','2022-04-03 00:48:58.071747','dd24945a-27fb-47d8-994f-7470d8aaf38a',1),('353a7717-3b19-464b-a739-1997983abf5e','Add the yogurt or mayonnaise, the mustard, a couple generous pinches of salt and pepper, celery, onion, and lemon juice. Mash with a fork. Don\'t completely overdo it, you want the egg mixture to have some texture. If you need to add a bit more yogurt to moisten up the mixture a bit, go for it a bit at a time. Taste, and adjust the seasoning - adding more salt and pepper if needed.','2022-03-13 23:39:14.291093','fed3dedf-43b3-4de5-9433-6028e601bcf1',3),('3ddf115d-140e-43fa-95a7-cb173578a883','Whisk egg, butter, and vanilla extract into \"soured\" milk until well combined. Pour flour mixture into the wet ingredients and whisk until just combined. Fold in chocolate chips. Batter will be thick. Allow batter to rest for 5 minutes.','2022-04-03 00:48:58.089417','dd24945a-27fb-47d8-994f-7470d8aaf38a',3),('61c5f939-ff1f-4d7e-8ff9-a92ef4a507be','Assemble the Coleslaw:','2022-03-20 23:18:49.367968','6570af5a-e811-45b8-a533-c4f06438e1ff',3),('6251bdb8-7d1b-48a9-8de0-83ebc03f758e','Meanwhile, prepare quinoa according to package instructions, boiling it with the cider vinegar and some of the lemon juice. When little white rings begin to form around the grains, drain any excess water and set quinoa aside.','2022-03-06 00:56:49.904226','ce7c42d8-f557-42e1-8e53-d9925bcafd3b',4),('6532ad90-1202-44c5-b4e0-804c65d83453','Mix all ingredients together in a bowl, Season with sat and pepper, to taste.','2022-03-06 02:44:19.127485','3cd3f061-f3bc-4042-84c6-bb5f13722996',1),('6afd4480-ca90-447c-9c9d-01e375c16a81','Place the eggs in a pot and cover with cold water by a 1/2-inch or so. Bring to a gentle boil. Now turn off the heat, cover, and let sit for exactly eight minutes. Have a big bowl of ice water ready and when the eggs are done cooking place them in the ice bath for three minutes or so - long enough to stop the cooking. Crack and peel each egg, place in a medium mixing bowl.','2022-03-13 23:39:14.289506','fed3dedf-43b3-4de5-9433-6028e601bcf1',2),('72d735e4-7306-4dff-8e87-f9796f629646','Grind the sesame seeds in a mortar and pestle or by pulsing in a food processor or blender until it is a fine meal. Add the tahini, lime juice, coco aminos or soy sauce, mirin, sugar, and sriracha. Stir until well combined. Stir in the warm water and stir, stir, stir, until creamy and uniform. Taste and add more sriracha of you like.','2022-03-20 23:18:49.366193','6570af5a-e811-45b8-a533-c4f06438e1ff',2),('88e83935-918c-4f50-bfe1-7c868765da99','In a large pot, heat the olive oil over medium heat. Add onion and garlic and sear quickly. Lower heat, add all of the spices, and sauté for approx. 2 min. Add sweet potatoes, carrots, bell pepper and fennel and sauté for approx. 2 more min.','2022-03-06 00:56:49.901238','ce7c42d8-f557-42e1-8e53-d9925bcafd3b',2),('8dc59338-86c5-4190-8491-ca3845872661','Combine flour, sugar, baking powder, baking soda, and salt in a large mixing bowl.','2022-04-03 00:48:58.080660','dd24945a-27fb-47d8-994f-7470d8aaf38a',2),('9580c945-254e-41fb-9280-71319dfb0f1f','Pour about ¼ cup of batter for each pancake onto the skillet. Cook until bubbles appear on the surface, 2 to 4 minutes. Flip pancake with a spatula, and cook until browned on the other side, 2 to 3 more minutes. Repeat with remaining batter. Serve immediately.','2022-04-03 00:48:58.095745','dd24945a-27fb-47d8-994f-7470d8aaf38a',5),('9778e53c-552b-448b-83c2-86b025020eac','Dunk bread in the egg mixture, soaking both sides. Transfer to the hot skillet and cook until golden, 3 to 4 minutes per side. Serve hot.','2022-03-20 22:14:34.291240','b4191208-a0a1-4ea3-a1ce-e6cdeca0af94',3),('9d9ad7bc-365f-4a8b-b112-9e91480436ba','Combine the cabbages, carrots, apple, scallions, and cilantro in a large bowl. Drizzle with about half of the spicy sesame dressing. Toss until everything is nicely coated, and then toss a bit more. Decide if you want more dressing and add a bit at a time until it is to your liking.','2022-03-20 23:18:49.369226','6570af5a-e811-45b8-a533-c4f06438e1ff',4),('b52d3d03-40a3-4254-a661-0c449e39c744','To assemble each egg salad sandwich: rub the toasts with garlic, place a bit of lettuce on a piece of toast, top with the egg salad mixture, and finish by creating a sandwich with a second piece of toast. Repeat with remaining slices.','2022-03-13 23:39:14.292716','fed3dedf-43b3-4de5-9433-6028e601bcf1',4),('b9cf8d28-8d18-41da-8e60-267730f02384','Peel and finely dice onion and garlic. Peel carrots and sweet potatoes and cut into bite-size pieces. Deseed and dice bell pepper. Remove leaves and core from fennel and chop rest into small pieces. Wash kale, remove leaves from stems, and cut or tear into bite-size pieces.','2022-03-06 00:56:49.899350','ce7c42d8-f557-42e1-8e53-d9925bcafd3b',1),('d446961b-e843-4b42-8fda-9e1393253e73','Heat a large skillet over medium-low heat, and coat with cooking spray.','2022-04-03 00:48:58.091774','dd24945a-27fb-47d8-994f-7470d8aaf38a',4),('d4e11aed-3de7-4856-9ca6-cccb2acdcf10','Make the Spicy Sesame Dressing:','2022-03-20 23:18:49.363053','6570af5a-e811-45b8-a533-c4f06438e1ff',1),('ef72eab5-6f1d-45fa-a26e-6da23c9b4629','Serve sprinkled with some extra sesame seeds. Leftover coleslaw will keep covered in the refrigerator for a few days. Simply re-toss and enjoy.','2022-03-20 23:18:49.370436','6570af5a-e811-45b8-a533-c4f06438e1ff',5),('f479ab51-b762-4a5d-8efd-418cc0845412','Stir in water, vegetable stock, and tomatoes and bring to a boil. Reduce heat and let simmer for approx. 15 – 20 min. until sweet potatoes are softened, but still firm.','2022-03-06 00:56:49.903094','ce7c42d8-f557-42e1-8e53-d9925bcafd3b',3);
