INSERT INTO `recipes` VALUES ('3cd3f061-f3bc-4042-84c6-bb5f13722996','Tartar Sauce',NULL,'Tartar_Sauce.jpg','','','','https://tastesbetterfromscratch.com/tartar-sauce/',1,'2022-03-06 02:44:17.897809','This homemade Tartar Sauce recipe is creamy and fresh! It only takes 5 minutes to make, and tastes so much better than store-bought!'),('6570af5a-e811-45b8-a533-c4f06438e1ff','Spicy Sesame Coleslaw',NULL,'Spicy_Sesame_Coleslaw.jpg','','20 mins','20 mins','https://www.101cookbooks.com/spicy-sesame-coleslaw/',1,'2022-03-20 23:18:47.975286','A spicy sesame coleslaw with feathery green and red cabbages along with carrots, apples, and scallions tossed with a spicy, creamy sesame dressing.'),('b4191208-a0a1-4ea3-a1ce-e6cdeca0af94','French Toast',NULL,'French_Toast.jpg','10 mins ','5 mins ','15 mins ','https://www.allrecipes.com/recipe/7016/french-toast-i/',1,'2022-03-20 22:14:31.963070','This delicious French toast recipe can be ready in about 15 minutes with eggs, milk, a few spices, and your favorite bread.'),('ce7c42d8-f557-42e1-8e53-d9925bcafd3b','Moroccan-inspired chickpea stew',NULL,'Moroccan-inspired_chickpea_stew.jpg','','45 min.','','https://www.kitchenstories.com/en/recipes/moroccan-inspired-chickpea-stew',1,'2022-03-06 00:56:48.735727','Peel and finely dice onion and garlic. Peel carrots and sweet potatoes and cut into bite-size pieces. Deseed and dice bell pepper. Remove leaves and core from fennel and chop rest into small pieces. Wash kale, remove leaves from stems, and cut or tear into bite-size pieces.'),('dd24945a-27fb-47d8-994f-7470d8aaf38a','Chocolate Chip Pancakes',NULL,'Chocolate_Chip_Pancakes.jpg','10 mins ','10 mins ','30 mins ','https://www.allrecipes.com/recipe/8375465/chocolate-chip-pancakes/',1,'2022-04-03 00:48:56.245812','This is a great recipe for homemade chocolate chip pancakes - they are essentially buttermilk pancakes with chocolate chips, only you make your own buttermilk.'),('fed3dedf-43b3-4de5-9433-6028e601bcf1','The Perfect Egg Salad Sandwich',NULL,'The_Perfect_Egg_Salad_Sandwich.jpg','','10 mins','18 mins','https://www.101cookbooks.com/egg-salad/',1,'2022-03-13 23:39:12.974131','The perfect egg salad sandwich is all about the little tweaks and a smart ratio of eggs to other ingredients. This is my favorite. Served on garlic-rubbed toasted bread with chopped celery, onion, and whole-grain mustard.');
/*!40000 ALTER TABLE `recipes` ENABLE KEYS */;
